step="calico-service-v3-30-1"
printf "Starting to run ${step}\n"

set -e
set +x
. /etc/sysconfig/heat-params
set -x

if [ "$NETWORK_DRIVER" = "calico" ]; then
    _prefix=${CONTAINER_INFRA_PREFIX:-quay.io/calico/}

    CALICO_DEPLOY=/srv/magnum/kubernetes/manifests/calico-deploy.yaml
    [ -f ${CALICO_DEPLOY} ] || {
    echo "Writing File: $CALICO_DEPLOY"
    mkdir -p $(dirname ${CALICO_DEPLOY})
    set +x

    CALICO_MANIFEST_COMPRESSED_BASE64=''
    echo ${CALICO_MANIFEST_COMPRESSED_BASE64} | base64 -d | gzip -d > ${CALICO_DEPLOY}

   # --- START CUSTOM CALICO VARIABLE MODIFICATIONS ---
    echo "Customizing Calico variables in ${CALICO_DEPLOY}..."
    CALICO_DEPLOY_TMP="${CALICO_DEPLOY}.vars.tmp"

    # 1. Add IP_AUTODETECTION_METHOD after the IP env var
    awk -v subnet_cidr="${CLUSTER_SUBNET_CIDR}" '
    /- name: IP$/ {
        print $0; # Print the "- name: IP" line
        getline; # Get the next line (should be value: "autodetect")
        print $0; # Print the value line
        if ($0 ~ /value: "autodetect"/) {
            print "            # Use fixed subnet CIDR to autodetect IP (supported since Calico v3.16.x)";
            print "            - name: IP_AUTODETECTION_METHOD";
            print "              value: \"cidr=" subnet_cidr "\"";
        }
        next
    }
    { print $0 }
    ' "${CALICO_DEPLOY}" > "${CALICO_DEPLOY_TMP}" \
    && mv "${CALICO_DEPLOY_TMP}" "${CALICO_DEPLOY}" \
    || { echo "Error: awk (IP_AUTODETECTION_METHOD) failed."; rm -f "${CALICO_DEPLOY_TMP}"; exit 1; }

    # 2. Change CALICO_IPV4POOL_IPIP value from "Always" to the actual value
    awk -v ipip_value="${CALICO_IPV4POOL_IPIP}" '
    {
        if ($0 ~ /- name: CALICO_IPV4POOL_IPIP/) {
            print $0; # Print the name line
            getline; # Get the next line (value line)
            sub(/value: "Always"/, "value: \"" ipip_value "\""); # Substitute value
            print $0; # Print modified value line
        } else {
            print $0; # Print other lines
        }
    }
    ' "${CALICO_DEPLOY}" > "${CALICO_DEPLOY_TMP}" \
    && mv "${CALICO_DEPLOY_TMP}" "${CALICO_DEPLOY}" \
    || { echo "Error: awk (CALICO_IPV4POOL_IPIP) failed."; rm -f "${CALICO_DEPLOY_TMP}"; exit 1; }

    # 3. Uncomment and set CALICO_IPV4POOL_CIDR to the actual value
    awk -v pool_cidr="${CALICO_IPV4POOL}" '
    {
        if ($0 ~ /# - name: CALICO_IPV4POOL_CIDR/) {
            sub(/^ *# - name: CALICO_IPV4POOL_CIDR/, "            - name: CALICO_IPV4POOL_CIDR"); # 12 spaces indent
            print $0; # Print modified name line
            getline; # Get the next line (commented value line)
            sub(/^ *#   value: "192\.168\.0\.0\/16"/, "              value: \"" pool_cidr "\""); # 14 spaces indent for value
            print $0; # Print modified value line
        } else {
            print $0; # Print other lines
        }
    }
    ' "${CALICO_DEPLOY}" > "${CALICO_DEPLOY_TMP}" \
    && mv "${CALICO_DEPLOY_TMP}" "${CALICO_DEPLOY}" \
    || { echo "Error: awk (CALICO_IPV4POOL_CIDR) failed."; rm -f "${CALICO_DEPLOY_TMP}"; exit 1; }

    echo "Calico variables customized."
    # --- END CUSTOM CALICO VARIABLE MODIFICATIONS ---

    echo "Customizing image paths in ${CALICO_DEPLOY}..."
    # Escape _prefix for sed, as it might contain characters like '/' which are delimiters in sed.
    # Using '#' as sed delimiter to avoid issues if _prefix contains '/'.
    ESCAPED_PREFIX=$(echo "${_prefix}" | sed 's#[\#&/]#\\&#g')

    # The regex for version matching (v[0-9.]\+[A-Za-z0-9.-]*) should match tags like v3.20.0, v3.20.0-alpha.1, v3.20.0-rancher1.
    # It matches 'v' followed by digits/dots, then alphanumeric, dot, or hyphen characters.
    # This ensures that the full original tag from the upstream manifest is replaced.
    # Using a temp file for sed to avoid issues with in-place editing on some systems/versions of sed, then rename.
    TMP_SED_FILE="${CALICO_DEPLOY}.tmp"

    sed -e "s#image: docker\.io/calico/cni:v[0-9.]\+[A-Za-z0-9.-]*#image: ${ESCAPED_PREFIX}cni:${CALICO_TAG}#g" \
        -e "s#image: docker\.io/calico/node:v[0-9.]\+[A-Za-z0-9.-]*#image: ${ESCAPED_PREFIX}node:${CALICO_TAG}#g" \
        -e "s#image: docker\.io/calico/kube-controllers:v[0-9.]\+[A-Za-z0-9.-]*#image: ${ESCAPED_PREFIX}kube-controllers:${CALICO_TAG}#g" \
        -e "s#image: docker\.io/calico/typha:v[0-9.]\+[A-Za-z0-9.-]*#image: ${ESCAPED_PREFIX}typha:${CALICO_TAG}#g" \
        "${CALICO_DEPLOY}" > "${TMP_SED_FILE}"

    if [ $? -ne 0 ]; then
        echo "Error: sed command failed to customize image paths."
        rm -f "${TMP_SED_FILE}" # Clean up temp file
        exit 1
    fi
    mv "${TMP_SED_FILE}" "${CALICO_DEPLOY}"
    if [ $? -ne 0 ]; then
        echo "Error: mv command failed to replace original manifest with customized version."
        exit 1
    fi
    echo "Image paths customized in ${CALICO_DEPLOY}."

    }

set -x

    until  [ "ok" = "$(kubectl get --raw='/healthz')" ]
    do
        echo "Waiting for Kubernetes API..."
        sleep 5
    done

    /usr/bin/kubectl apply -f ${CALICO_DEPLOY} --namespace=kube-system
fi

printf "Finished running ${step}\n"
